            <div className={style.headrComponent}>
                <div className={style.headerLabel}>

                    <Link to="/home">Home</Link>
                    </div>
                    <div className={style.headerLabel}>

                    <Link to="/contact">Contact Us</Link>
                    </div>

                    <div className={style.headerLabel}>

                    <Link to="/about">AboutUs</Link>
                    </div>



            </div>
        </div>
    );

}


export default Header
